import styled from 'styled-components';

export const Button = styled.p`
    color: #FFFFFF;
    font-family: "poppins";
    font-size: 30px;
    background-color: #F7B718;
    width: 3000px;
    width: 60px;
`;
export const ButtonContainer = styled.div`
    display: flex;
    justify-content: center;
    align-items:center;
    width: 100%;
`;
